(1, 'Goa', 0x676f61312e6a7067, 'Goa is one of the most favorite destination among Indian tourists due to its pristine beaches. Dotted with\r\n        hundreds of impressive beaches in Goa, the incredible coastline of more than 100 km offers beautiful views and\r\n        serenity where tourists enjoy and relax in the Sun.', 'Glimpse Of Goa', ' Rating:  &#9733; &#9733; &#9733; &#9733; &#9733;', '4 days 3 nights <br> @12000/person', '<h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374312e6a7067, 12000),
(2, 'Singapore', 0x73696e6761706f7265312e6a7067, 'Best described as a microcosm of modern Asia, Singapore is a melting pot of culture and history, and an extravaganza of culinary delights. Officially known as the Republic of Singapore, it is both a city and a country located in Southeast Asia. One of Asia most visited destinations, Singapore is best described as an amalgam of a fast-paced life and an off-the-back-street inheritance.', 'Singapore Delight', ' Rating:  &#9733; &#9733; &#9733; &#9733; &#9733;', '5 days 4 nights <br> @66000/person', '<h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 5:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>\r\n', 0x6c617374322e6a7067, 66000),
(3, 'Dubai', 0x6475626169312e6a7067, ' As the eponymous capital of one of the UAE’s 7 emirates, the city is known for its riches, its glitzy and innovative development and architecture, and its shopping scenes. From the tranquillity of the deserts to the hubbub of the souks, there is a huge range of things to see and do in Dubai. You can explore vast dunes, traditional villages and remarkable skyscrapers throughout your stay.', 'Shimmery Dubai', ' Rating:  &#9733; &#9733; &#9733; &#9733; &#9733;', '5 days 4 nights <br> @50000/person', ' <h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 5:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374332e6a7067, 50000),
(4, 'France', 0x6672616e6365312e6a7067, 'France’s natural destinations will take your breath away. From the stunning Chaîne des Puys in Auvergne to the Camargue plains and their incredible variety of plants and wildlife, not to mention all of the regional nature parks and the UNESCO natural heritage sites. Along hiking trails, nature trails, or one of the canals, there are a thousand outdoor activities from which to choose. Take in the best views in France, stop in charming villages, and enjoy typical local French cuisine and authentic', 'Swiss & Paris Tour Delight', ' Rating:  &#9733; &#9733; &#9733; &#9733; &#9733;', '10 days 9 nights <br> @140000/person', '    <h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f;  &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &#xf594;<br>\r\n        <h5>Sight seeing and change hotel</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 5:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 6:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f;  &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Sight seeing and change hotel</h5>\r\n        </i>\r\n        <h4>Day 7:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 8:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f;  &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &#xf594;            <h5>Sight seeing and change hotel</h5>\r\n        </i>\r\n        <h4>Day 9:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 10:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374342e6a7067, 140000),
(5, 'Spain', 0x737061696e312e6a7067, 'Spain itself is a natural wonder. The Pyrenees and Picos de Europa are as beautiful as any mountain range on the continent, while the snowcapped Sierra Nevada rises up improbably from the sun-baked plains of Andalucía. The wildly beautiful cliffs of Spain’s Atlantic northwest are offset by the charming coves of the Mediterranean.', 'Classic Spain', ' Rating:  &#9733; &#9733; &#9733; &#9733; &#9734;', '6 days 5 nights <br> @70000/person', '    <h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f;  &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &#xf594;<br>\r\n        <h5>Sight seeing and change of hotel</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 5:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 6:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374352e6a7067, 70000),
(6, 'Europe', 0x6575726f7065312e6a7067, 'Tourism in Europe is a thriving industry with nearly 500 million travelers visiting here every year. From bohemian Prague to playful Paris and from lively Lisbon to eternal Rome, Europe has some of the best travel destinations in the world. ', 'Tops of Europe & Titlis ', 'Rating:  &#9733; &#9733; &#9733; &#9733; &#9733;', '5 days 4 nights <br> @80000/person', ' <h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 5:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374362e6a7067, 80000),
(7, 'Shimla', 0x7368696d6c61312e6a7067, 'Shimla, one of India s most famous hill stations, derives its name from Goddess Shyamala, an incarnation of Goddess Kali, the deity of power and wrath. However, unlike its name, Shimla is a perfect heaven for the ones in search of tranquility. Nature has blessed this capital city with innumerable gifts and man has used them to make Shimla one of India s best locales.', 'Allure Of Shimla', 'Rating:  &#9733; &#9733; &#9733; &#9733; &#9733;', '3 days 2 nights <br> @8000/person', ' <h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374372e6a7067, 8000),
(8, 'Leh Ladakh', 0x6c6568312e6a7067, 'The Land of High Passes, Ladakh, the newly created Union Territory in India (previously a part of Jammu & Kashmir), boasts a landscape that can leave you with your jaws dropped. It is a place where the landscape changes dramatically; it is truly astonishing to see the mountains, snow, cold desert, alpine meadows and lakes at a short distance from each other. Tourism in Ladakh is an absolute delight for nature lovers as well as adventurers.', 'Best Of Ladakh', 'Rating:  &#9733; &#9733; &#9733; &#9733; &#9734;', '6 days 5 nights <br> @32000/person', ' <h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f;  &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &#xf594;<br>\r\n        <h5>Sight seeing and change of hotel</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 5:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 6:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374382e6a7067, 32000),
(9, 'Gujarat', 0x67756a61726174312e6a7067, 'It is renowned for its beaches, temple towns and historic capitals. Wildlife sanctuaries, hill resorts and natural grandeur are gifts of Gujarat. Sculpture, handicrafts, arts, festivals also make the state rich.', 'Bhuj trip', 'Rating:  &#9733; &#9733; &#9733; &#9733; &#9734;', '5 days 4 nights <br> @25000/person', ' <h3>Package Itinerary</h3> <br>\r\n        <h4>Day 1:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check in</h5>\r\n        </i>\r\n        <h4>Day 2:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 3:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n        <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 4:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf59f; <br>\r\n            <h5>Sight seeing</h5>\r\n        </i>\r\n        <h4>Day 5:</h4> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <i style=\'font-size:24px\' class=\'fas\'> &nbsp; &nbsp;\r\n            &nbsp; &nbsp; &#xf594; <br>\r\n            <h5>Check out</h5>\r\n        </i>', 0x6c617374392e6a7067, 25000);

